import './styles.css'
import Tra from '../../assets/images/traxanh0do.png'
export default function Home() {
    return (
        <div class="container-fluid">
            <div class="row g-0">
                <img src={Tra} alt="Tra xanh 0 do" width="100%" height="auto" />
            </div>
        </div>

    )
}
